    var idClaseProfesor = req.query.IdClaseProfesor;

    var query = `UPDATE claseprofesor
                    SET Hablitada = false
                WHERE ID = ${idClaseProfesor}`;

    return pool.promise().query(query)
        .then(() => { return ({ Success: true }) })
